import axios from 'axios';

 export default async function getDogs() {
    return function(dispatch) {
        fetch(`http://localhost:3001/dogs`)
        .then(response => response.json())
        .then(json => dispatch(
            {
            type:"GET_DOGS",
            payload: json
        }))
        
    }
}
